    write("{\n");

    write("<a href=\"#\" onClick=\"javascript:parent.Cts('000000000002817','');\"><img src=\"../img/ABBREVIATION.PNG\" alt=\"Abbreviation\" border=\"0\"></a>\n");
    write("</td></tr></table>\n");
    write("</td>\n");
    write("</tr>\n");
    write("</table>\n");
  }

              "<td align=\"center\" style=\"font-size:medium\">Title</td>");

    document.write("<tr><td>There is no Shop Manual to apply</td></tr>");
  }
  else {
    for (i=0; i < tDT.length; ++i) {
      if (tDT[i].Display == true) {
        strEventClick = "javascript:parent.Cts('" + tDT[i].contentsNum + "','')";
          strText = tDT[i].Title;

             strText += "(" + tDT[i].Dgc + ")";

      }
    }
  }
  with(document)
